bool is_singular( Matrix a) {
    for (int i = 0; i < a.get_n(); i++) {
        double m = 0;
        int m_i = 0;
        for (int j = i; j < a.get_n(); j++) {
            if (abs(a.get(j, i)) > abs(m))  {
                m = a.get(j, i);
                m_i = j;
            }
        }
        if (m_i != i) {
            PermutationMatrix p(a.get_n(), m_i + 1, i + 1);
            a = p * a;
        }
        for (int j = i + 1; j < a.get_n(); j++) {
            if (a.get(j, i) != 0) {
                EliminationMatrix e(a, j + 1, i + 1);
                a = e * a;
            }   
        }
    }
    for (int i = 0; i < a.get_n(); i++) {
        if (a.get(i, i) == 0) {
            return 0;
        }
    }
    return 1;
}
