const int MAX = 1e9;
const int MOD = 1000000007;
const ll  INF = 1e18;
const ld  PI  = 3.14159265358979323846;

struct calculator {
    int l = 0, r = -1;
    vt<int> color;
    vt<deque<int> > mp;
    multiset<int> st;

    calculator() {}

    calculator(vt<int> _color) {
        color = _color;
        mp.resize(color.size());
    }

    void remove(int idx) {
        if (mp[color[idx]].size() > 1) {
            int v = mp[color[idx]].back() - mp[color[idx]].front();
            st.erase(st.find(v));
        }
    }

    void add(int idx) {
        if (mp[color[idx]].size() > 1) {
            int v = mp[color[idx]].back() - mp[color[idx]].front();
            st.insert(v);
        }
    }

    void add_left() {
        remove(l - 1);
        mp[color[l - 1]].push_front(l - 1);
        add(l - 1);
        l--;
    }

    void add_right() {
        remove(r + 1);
        mp[color[r + 1]].push_back(r + 1);
        add(r + 1);
        r++;
    }

    void remove_left() {
        remove(l);
        mp[color[l]].pop_front();
        add(l);
        l++;
    }

    void remove_right() {
        remove(r);
        mp[color[r]].pop_back();
        add(r);
        r--;
    }

    int get_ans() {
        if (st.empty()) return 0;
        return *st.rbegin();
    }
};

int block_size = 500;

struct MO {
    calculator c;

    MO () {}

    MO (calculator c) : c(c) {}

    struct Query {
        int l, r, idx;
        bool operator<(Query other) const {
            return make_pair(l / block_size, r) <
                make_pair(other.l / block_size, other.r);
        }
    };

    vt<int> solve(vt<Query> queries) {
        vt<int> answers(queries.size());
        sort(queries.begin(), queries.end());

        // invariant: data structure will always reflect the range [cur_l, cur_r]
        for (Query q : queries) {
            while (c.l > q.l) c.add_left();
            while (c.r < q.r) c.add_right();
            while (c.l < q.l) c.remove_left();
            while (c.r > q.r) c.remove_right();
            answers[q.idx] = c.get_ans();
        }

        return answers;
    }
};

void solve() {
    int n, q; cin >> n >> q;
    vt<int> a(n); read(a);
    vt<ll> pref_sum(n + 1);
    map<ll, int> mp;
    mp[0] = 1;
    For(i, n) {
        pref_sum[i + 1] += pref_sum[i] + a[i];
        mp[pref_sum[i + 1]] = 1;
    }
    int cur = 0;
    for (auto p : mp) {
        mp[p.first] = cur++;
    }
    vt<int> color(n + 1);
    For(i, n + 1) {
        color[i] = mp[pref_sum[i]];
    }
    calculator c = calculator(color);
    MO mo = MO(c);
    vt<MO::Query> queries;
    For(i, q) {
        int l, r; cin >> l >> r; l--;
        queries.push_back(MO::Query{l, r, i});
    }

    vt<int> ans = mo.solve(queries);
    For(i, q) {
        cout << ans[i] << endl;
    }
}

